  "estado_visible": "1",
  "titulo": "Celebramos nuestro primer aniversario",
  "autor": "UrbanHub",
  "imagen": "007.png",
  "contenido": "<span>Hace un año iniciamos un\r\nproyecto que recibiría e impulsaría a empresarios y emprendedores para alcanzar\r\nsus metas. El pasado 25 de Julio lo celebramos con nuestros UrbanHubers, hubo un sorteo, regalos, comida y\r\nmuchas sorpresas más. <br></span>\r\n\r\n<br>A lo largo del año hemos\r\ntenido eventos mensuales como UrbanTalks donde las personas vienen a UrbanHub a\r\nescuchar ponentes que son líderes en la industria y nos comparten sus historias\r\nde éxito. <br>\r\n\r\n<br>Al igual, hemos creado\r\namigos y fomentado las alianzas con diferentes empresas, esto en beneficio para\r\nnuestros UrbanHubers. Queremos agradecer a cada una de ellas por acompañarnos\r\ndurante este año y crecer junto a nosotros.<br>&nbsp;Las empresas que se\r\nencuentran con nosotros están creciendo y están felices de pertenecer a una\r\ncomunidad que fomenta la creatividad y productividad. Estamos encantados de los\r\nresultados y esperamos acompañarlos por muchos años más.&nbsp;\r\n\r\n<br><br>Estamos muy agradecidos\r\ncon todas las empresas que han confiado en nosotros para ser su lugar de\r\ntrabajo, su sala de reuniones y a veces hasta su segunda casa. Nos encanta\r\nverlos crecer y nuestra meta es que juntos sigamos alcanzando éxitos.",
